e effect across your website. %s.'=>'Změňte globální meta nastavení, která se projeví na celém vašem webu. %s.','Edit the contents of your .htaccess file easily. %s.'=>'Snadno upravujte obsah souboru .htaccess. %s.','Change some uncommon but essential settings here. %s.'=>'Změňte zde některá neobvyklá, ale zásadní nastavení. %s.','Enter verification codes for third-party webmaster tools. %s'=>'Zadejte ověřovací kódy pro nástroje pro webmastery třetích stran. %s','Use the following code in your theme template files to display breadcrumbs.'=>'Pro zobrazení drobečkové navigace použijte v souborech šablony následující kód.','Here you can set up the breadcrumbs function. %s'=>'Zde můžete nastavit funkci drobečkové nabigace. %s','Change how some of the links open and operate on your website. %s.'=>'Změňte způsob, jakým se některé odkazy otevírají a fungují na vašich webových stránkách. %s.','Advanced Mode'=>'Pokročilý mód','Easy Mode'=>'Snadný režim','Optimize WooCommerce Pages for Search Engines by adding required metadata and Product Schema which will make your site stand out in the SERPs.'=>'Optimalizujte stránky WooCommerce pro vyhledávače přidáním požadovaných metadat a schématu produktů, které učiní vaše stránky vyniknou v SERPs.','Install %s to make Rank Math work with Accelerated Mobile Pages. Rank Math automatically adds required meta tags in all the AMP pages.'=>'Nainstalujte %s, aby Rank Math fungovalo se zrychlenými mobilními stránkami. Rank Math automaticky přidá požadované meta tagy na všech stránkách AMP.','The Role Manager allows you to use WordPress roles to control which of your site users can have edit or view access to Rank Math\'s settings.'=>'Správce rolí umožňuje používat role WordPress k řízení, které z vašich stránek mohou uživatelé upravovat nebo zobrazovat přístup k nastavení Rank Math.','Advanced Image SEO options to supercharge your website. Automate the task of adding the ALT and Title tags to your images on the fly.'=>'Pokročilé Image SEO mo