k pro %1$s. %2$s.','Easily create redirects without fiddling with tedious code. %s.'=>'Snadno vytvářejte přesměrování bez hraní s nudným kódem. %s.','Monitor broken pages that ruin user-experience and affect SEO. %s.'=>'Monitorujte nefunkční stránky, které ničí uživatelské prostředí a ovlivňují SEO. %s.','Conversion started. A success message will be shown here once the process completes. You can close this page.'=>'Převod byl spuštěn. Po dokončení procesu se zde zobrazí zpráva o úspěchu. Tuto stránku můžete zavřít.','WordPress Dashboard > Settings > Permalinks > Product permalinks Example: default: /product/accessories/action-figures/acme/ - becomes: /accessories/action-figures/acme/'=>'WordPress Dashboard > Nastavení > Permalinks > Produkt permalinks Příklad: výchozí: /product/accessories/action-figures/acme/ - se stává: /accessories/action-figures/acme/','Choose how you want Rank Math to handle your WooCommerce SEO. %s.'=>'Vyberte si, jak chcete Rank Math zvládnout vaše WooCommerce SEO. %s.','Automatic updates are not enabled on your site. %s'=>'Automatické aktualizace nejsou na vašem webu povoleny. %s','The error log cannot be retrieved: Error log file is too large.'=>'Protokol chyb nelze načíst: Soubor protokolu chyb je příliš velký.','The error log cannot be retrieved.'=>'Protokol chyb nelze načíst.','Edit your robots.txt file to control what bots see. %s.'=>'Upravte soubor robots.txt pro kontrolu toho, co roboti vidí. %s.','Edit Page: '=>'Upravit stránku: ','Static page is set as the front page (WP Dashboard > Settings > Reading). To add SEO title, description, and meta for the homepage, please click here: %s'=>'Statická stránka je nastavena jako titulní strana (WP Dashboard > Nastavení > čtení). Chcete-li přidat SEO název, popis a meta pro domovskou stránku, klikněte prosím zde: %s','Click here to Deactivate'=>'Klikněte zde pro deaktivaci','You are not allowed to deactivate this plugin: %s.'=>'Tento plugin nesmíte deaktivovat: %s.','Sorry, you are not allowe