cription'=>'Meta popis domovské stránky','Homepage title tag.'=>'Značka názvu domovské stránky.','Homepage Title'=>'Název domovské stránky','Card type selected when creating a new post. This will also be applied for posts without a card type selected.'=>'Typ karty vybraný při vytváření nového příspěvku. To bude také použita pro příspěvky bez vybraného typu karty.','Twitter Card Type'=>'Typ karty Twitter','OpenGraph Thumbnail'=>'Miniatura OpenGraph','Capitalize Titles'=>'Velká písmena v názvech','You can use the separator character in titles by inserting <code>%separator%</code> or <code>%sep%</code> in the title fields.'=>'Znak oddělovače v názvech můžete použít vložením <code>%separator%</code> nebo <code>%sep%</code> v polích nadpisu.','Default values for robots meta tag. These can be changed for individual posts, taxonomies, etc.'=>'Výchozí hodnoty metaznačky robots. Ty lze změnit pro jednotlivé příspěvky, taxonomie, atd.','Add SEO Controls for user profile pages. Access to the Meta Box can be fine tuned with code, using a special filter hook.'=>'Přidání ovládacích prvků SEO pro stránky uživatelského profilu. Přístup k Meta Boxu lze doladit kódem pomocí speciálního filtrovacího háčku.','Author archive meta description. SEO options for specific author archives can be set with the meta box in the user profiles.'=>'Autor archiv meta popis. SEO možnosti pro konkrétní autora archivů lze nastavit s meta box v uživatelských profilech.','Author Archive Description'=>'Popis archivu autorů','Title tag on author archives. SEO options for specific authors can be set with the meta box available in the user profiles.'=>'Název značky v archivu autorů. SEO možnosti pro konkrétní autory lze nastavit s meta box k dispozici v uživatelských profilech.','Author Archive Title'=>'Název archivu autora','Change the <code>/author/</code> part in author archive URLs.'=>'Změňte <code>/author/</code> část v adresách URL archivu autorů.','Author Base'=>'Základní URL autorů','Enabled'=>'Zapnuto','Disabled'=>'Vypnuto','Author Archives'=>'Archiv autorů','Norton Ownership Verification Page'=>'Stránka ověření vlastnictví norton','Enter your Norton Safe Web verification HTML code or ID. Learn how to get it: %s'=>'Zadejte html kód nebo ID ověření produktu Norton Safe Web. Zjistěte, jak jej získat: %s','Norton Safe Web Verification ID'=>'Id ověření bezpečného webu Norton','Pinterest Account'=>'Účet Pinterestu','Enter your Pinterest verification HTML code or ID. Learn how to get it: %s'=>'Zadejte ověřovací HTML kód nebo ID Pinterestu. Zjistěte, jak jej získat: %s','Pinterest Verification ID'=>'Identifikační číslo pro ověření na Pinterestu','Yandex.Webmaster Page'=>'Stránka Yandex.Webmaster','Enter your Yandex verification HTML code or ID. Learn how to get it: %s'=>'Zadejte svůj ověřovací HTML kód nebo ID Yandex. Jak jej získat: %s','Yandex Verification ID'=>'Identifikační číslo pro ověření Yandex','Enter your Baidu Webmaster Tools verification HTML code or ID. Learn how to get it: %s'=>'Zadejte ověřovací HTML kód nebo ID nástrojů pro webmastery Baidu. Zjistěte, jak jej získat: %s','Baidu Webmaster Tools'=>'Nástroje pro webmastery Baidu','Bing Webmaster Verification Page'=>'Stránka ověření Bing Webmaster','Enter your Bing Webmaster Tools verification HTML code or ID. Get it here: %s'=>'Zadejte ověřovací HTML kód nebo ID nástrojů pro webmastery Bing. Získejte jej zde: %s','Bing Webmaster Tools'=>'Nástroje pro webmastery Bing','Search Console Verification Page'=>'Ověřovací stránka konzoly Search Console','Enter your Google Search Console verification HTML code or ID. Learn how to get it: %s'=>'Zadejte ověřovací HTML kód nebo ID služby Google Search Console. Zjistěte, jak jej získat: %s','Google Search Console'=>'Vyhledávací služba Google','Featured image of the article.'=>'Nejlepší obrázek článku.','A link to your site, with your site\'s name and description as anchor text.'=>'Odkaz na vaše stránky, s názvem a popisem vašeho webu jako ukotvení textu.','A link to your site, with your site\'s name as anchor text.'=>'Odkaz na vaše stránky, s názvem vašeho webu jako kotva text.','A link to the post, with the title as anchor text.'=>'Odkaz na příspěvek s názvem jako ukotvení textu.','A link to the archive for the post author, with the authors name as anchor text.'=>'Odkaz na archiv pro autora příspěvku, s názvem autorů jako kotva text.','Variable'=>'Proměnná','Available variables'=>'Dostupné proměnné','Contents are locked because a robots.txt file is present in the root folder.'=>'Obsah je uzamčen, protože soubor robots.txt je přítomen v kořenové složce.','Add content after each post in your site feeds.'=>'Přidejte obsah za každý příspěvek v informačních kanálech webu.','RSS After Content'=>'RSS za obsahem','Add content before each post in your site feeds.'=>'Přidejte obsah před každý příspěvek do informačních kanálů webu.','RSS Before Content'=>'RSS před obsahem','Usage Tracking'=>'Sledování využití','Automatically add <code>target="_blank"</code> attribute for external links appearing in your posts, pages, and other post types to make them open in a new browser tab or window. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'Automaticky přidejte <code>target="_blank"</code> atribut pro externí odkazy, které se zobrazují ve vašich příspěvcích, stránkách a dalších typech příspěvků, aby se otevřely v nové kartě nebo okně prohlížeče. Atribut je dynamicky použit při zobrazení obsahu a uložený obsah se nezmění.','The <code>nofollow</code> attribute <strong>will not be added</strong> for the link if target domain is in this list. Add one per line.'=>'<code>nofollow</code>Atribut <strong>nebude přidán</strong> pro odkaz, pokud je v tomto seznamu cílová doména. Přidejte jeden na řádek.','Nofollow Exclude Domains'=>'Vyloučení nofollow domén','Only add <code>nofollow</code> attribute for the link if target domain is in this list. Add one per line. Leave empty to apply nofollow for <strong>ALL</strong> external domains.'=>'Atribut pro odkaz přidejte pouze <code>nofollow</code> v případě, že je v tomto seznamu cílová doména. Přidejte jeden na řádek. Ponechat prázdné použít nofollow pro <strong>všechny</strong> externí domény.','Nofollow Domains'=>'Nofollow domény','Redirect attachments without a parent post to this URL. Leave empty for no redirection.'=>'Přesměrovat přílohy bez nadřazeného příspěvku na tuto adresu URL. Ponechte prázdné pro žádné přesměrování.','Redirect all attachment page URLs to the post they appear in. For more advanced redirection control, use the built-in %s.'=>'Přesměrujte všechny adresy URL stránek příloh na příspěvek, ve kterých se zobrazují. Pro pokročilejší řízení přesměrování použijte vestavěné %s.','Redirect Attachments'=>'Přesměrovat přílohy','Please enable Redirections module.'=>'Povolte modul Přesměrování.','Redirections Manager'=>'Správce přesměrování','Redirection Manager'=>'Správce přesměrování','Why do this?'=>'Proč to děláš?','Remove /category/ from category archive URLs. %s <br>E.g. <code>example.com/category/my-category/</code> becomes <code>example.com/my-category</code>'=>'Odeberte /category/ z adres URL archivu kategorií. %s<br>Např. <code>example.com/category/my-category/</code><code>example.com/my-category</code>','Format used for the new <code>title</code> attribute values.'=>'Formát použitý pro nové <code>title</code> hodnoty atributů.','Title attribute format'=>'Formát atributu nadpisu','Add <code>TITLE</code> attribute for all <code>images</code> without a <code>TITLE</code> attribute automatically. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'Přidejte <code>TITLE</code> atribut pro všechny bez <code>images</code> <code>TITLE</code> atributu automaticky. Atribut je dynamicky použit při zobrazení obsahu a uložený obsah se nezmění.','Add missing TITLE attributes'=>'Přidání chybějících atributů TITLE','Format used for the new <code>alt</code> attribute values.'=>'Formát použitý pro nové <code>alt</code> hodnoty atributů.','Alt attribute format'=>'Formát atributu Alt','Add <code>alt</code> attributes for <code>images</code> without <code>alt</code> attributes automatically. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'Automatické přidání <code>alt</code> atributů <code>images</code> bez <code>alt</code> atributů. Atribut je dynamicky použit při zobrazení obsahu a uložený obsah se nezmění.','Be careful when editing the htaccess file, it is easy to make mistakes and break your site. If that happens, you can restore the file to its state <strong>before the last edit</strong> by replacing the htaccess file with the backup copy created by Rank Math in the same directory (<em>.htaccess_back_xxxxxx</em>) using an FTP client.'=>'Buďte opatrní při úpravách souboru htaccess, je snadné dělat chyby a rozbít vaše stránky. Pokud k tomu dojde, můžete soubor obnovit do stavu <strong>před poslední úpravou</strong> nahrazením souboru htaccess záložní kopií vytvořenou službou Rank Math ve stejném adresáři<em>(.htaccess_back_xxxxxx</em>) pomocí klienta FTP.','I understand the risks and I want to edit the file'=>'Rozumím rizikům a chci soubor upravit','.htaccess file is not writable.'=>'Soubor HTaccess není zapisovatelný.','.htaccess file not found.'=>'Soubor HTaccess nebyl nalezen.','Hide Taxonomy Name from Breadcrumb.'=>'Skrýt název taxonomie z drobečku cesty.','Hide Taxonomy Name'=>'Skrýt název taxonomie','If category is a child category, show all ancestor categories.'=>'Pokud kategorie je podřízená kategorie, zobrazit všechny kategorie předchůdce.','Show Category(s)'=>'Zobrazit kategorii(e)','Hide Post title from Breadcrumb.'=>'Skrýt název příspěvku z drobečkové naviagce.','Hide Post Title'=>'Skrýt název příspěvku','Label used for 404 error item in breadcrumbs.'=>'Popisek použitý pro chybovou položku 404 v drobečky.','404 label'=>'404 štítek','Format