,'Remove base'=>'Odebrat základnu','Product\'s brand of the current product'=>'Značka produktu aktuálního produktu','Product\'s brand.'=>'Značky produktu.','Product\'s short description of the current product'=>'Stručný popis aktuálního produktu','Product\'s short description.'=>'Krátký popis produktu.','Product\'s SKU of the current product'=>'Skladové jednotky aktuálního produktu','Product\'s SKU.'=>'SKU produktu.','Product\'s price of the current product'=>'Cena produktu aktuálního produktu','Product\'s price.'=>'Cena produktu.','Include archive pages of terms that have no posts associated.'=>'Zahrnout archivní stránky termínů, které nemají žádné příspěvky spojené.','Include Empty Terms'=>'Zahrnout prázdné termíny','Include archive pages for terms of this taxonomy in the XML sitemap.'=>'Zahrnout stránky archivu pro termíny této taxonomie do mapy webu XML.','Insert custom field (post meta) names which contain image URLs to include them in the sitemaps. Add one per line.'=>'Vložte názvy vlastních polí (post meta), které obsahují adresy URL obrázků, a zahrňte je do souboru Sitemap. Přidejte jeden na řádek.','Image Custom Fields'=>'Vlastní pole obrázku','Include this post type in the XML sitemap.'=>'Zahrnout tento typ příspěvku do XML mapy stránek.','Include in Sitemap'=>'Zahrnout do mapy stránek','Add term IDs, separated by comma. This option is applied for all taxonomies.'=>'Přidejte termín ID, oddělený čárkou. Tato možnost se používá pro všechny taxonomie.','Exclude Terms'=>'Vyloučit výrazy','Enter post IDs of posts you want to exclude from the sitemap, separated by commas. This option **applies** to all posts types including posts, pages, and custom post types.'=>'Zadejte ID příspěvků, které chcete vyloučit z mapy stránek, oddělené čárkami. Tato volba **se použije** pro všechny typy příspěvků, včetně příspěvků, stránek a vlastních typů příspěvků.','Exclude Posts'=>'Vyloučit příspěvky','Include the Featured Image too, even if it does not appear directly in the post content.'=>'Zahrňte také doporučený obrázek, i když se nezobrazuje přímo v obsahu příspěvku.','Include Featured Images'=>'Zahrnout náhledové obrázky','Include reference to images from the post content in sitemaps. This helps search engines index the important images on your pages.'=>'Do souboru Sitemap zahrňte odkaz na obrázky z obsahu příspěvku. To pomáhá vyhledávačům indexovat důležité obrázky na vašich stránkách.','Images in Sitemaps'=>'Obrázky v mapě stránek','Max number of links on each sitemap page.'=>'Maximální počet odkazů na každé stránce mapy stránek.','Links Per Sitemap'=>'Počet odkazů na mapu stránek','Add user IDs, separated by commas, to exclude them from the sitemap.'=>'Přidejte ID uživatele oddělené čárkami, abyste je vyloučili z mapy stránek.','Exclude Users'=>'Vyloučit uživatele','Exclude User Roles'=>'Vyloučit role uživatelů','XML Sitemap %1$s %2$s'=>'XML mapa stránek %1$s %2$s','Rank Math has detected new post types: %1$s. You may want to check the settings of the <a href="%2$s">Titles &amp; Meta page</a> and <a href="%3$s">the Sitemap</a>.'=>'Rank Math zjistil nové typy příspěvků: %1$s. Možná budete chtít zkontrolovat nastavení stránky <a href="%2$s">Tituly &; Meta</a> a <a href="%3$s">Stránky mapy</a>.','%s archives'=>'archivy %s','your product %s pages'=>'vaše produktové stránky %s','Taxonomies:'=>'Taxonomie:','Please note that this will add the attachment page URLs to the sitemap, not direct image URLs.'=>'Vezměte prosím na vědomí, že toto přidá URL stránky s přílohami do mapy stránek, ne přímo URL obrázků.','Sitemap URL: %s'=>'Adresa URL mapy stránek: %s','single %s'=>'jednotlivé %s','your product pages'=>'stránky produktů','attachments'=>'přílohy','Set the sitemap options for author archive pages. %s.'=>'Nastavte možnosti mapy webu pro stránky archivu autorů. %s.','This tab contains General settings related to the XML sitemaps.'=>'Tato karta obsahuje obecná nastavení související s mapami webu XML.','No sitemaps found.'=>'Nenalezeny žádné soubory sitemap.','Your site has one or more sitemaps.'=>'Vaše stránka má jednu nebo více map stránek.','+%d More...'=>'+%d více…','There are %s published posts where the primary focus keyword does not appear in the post title.'=>'Existuje %s publikovaných příspěvků, kde se klíčové slovo primárního zájmu neobjevuje v názvu příspěvku.','Focus keywords appear in the titles of published posts where it is set.'=>'Klíčová slova se zobrazují v názvech publikovaných příspěvků, kde jsou nastavena.','There are %s with no focus keyword set.'=>'Existuje %s s žádným nastaveným klíčovým slovem.','All published posts have focus keywords set.'=>'Všechny publikované příspěvky mají nastavená klíčová slova.','You have not linked Google Search Console yet.'=>'Dosud jste nepropojili službu Google Search Console.','Google Search Console has been linked.'=>'Služba Google Search Console byla propojena.','Post permalink structure is set to %s.'=>'Struktura post permalink je nastavena na %s.','Permalinks are set to a custom structure but the post titles do not appear in the permalinks.'=>'Permalinks jsou nastaveny na vlastní strukturu, ale názvy příspěvku se nezobrazují v permalinks.','Permalinks are set to the default value. <em>Pretty permalinks</em> are disabled. '=>'Permalinky jsou nastaveny na výchozí hodnotu. <em>”Hezké” permalinky.</em> jsou zakázány. ','Your Site Tagline is set to a custom value.'=>'Tagline webu je nastaven na vlastní hodnotu.','Your Site Tagline is set to the default value <em>Just another WordPress site</em>.'=>'Tagline webu je nastavena na výchozí hodnotu <em>Pouze jiný web WordPress</em>.','If you don\'t have an XML sitemap, the best option is to install a plugin that creates sitemaps for you. That way you\'ll know the sitemap will always be up-to-date. Plugins can also automatically ping the search engines when the XML file is updated. The Rank Math WordPress plugin gives you complete control over your site\'s XML sitemaps. You can control the settings for each page as you write or edit it, and Rank Math will ping Google as soon as you submit your edits. This results in fast crawls and indexing.'=>'Pokud nemáte XML mapu, nejlepší možností je nainstalovat plugin, který pro vás vytváří mapu stránek. Takto budete vědět, že mapa stránek bude vždy aktuální. Pluginy mohou také automaticky ping vyhledávačů po aktualizaci XML. Rank Math WordPress plugin vám dává plnou kontrolu nad XML stránek. Nastavení každé stránky můžete nastavit tak, jak ji píšete nebo upravujete. Rank Math bude upozorňovat Google, jakmile odešlete své úpravy. To má za následek rychlé prostudování a indexování.','XML sitemaps are a special type of text file that tells search engines about the structure of your site. They\'re a list of all the resources (pages and files) you would like the search engine to index. You can assign different priorities, so certain pages will be crawled first. Before XML sitemaps, search engines were limited to indexing the content they could find by following links. That\'s still an important feature for search engine spiders, but XML sitemaps have made it easier for content creators and search engines to collaborate.'=>'Soubor SITEMAP XML je zvláštní typ textového souboru, který informuje vyhledávače o struktuře vašeho webu. Jsou to seznam všech zdrojů (stránky a soubory), které chcete vyhledávač indexovat. Můžete přiřadit různé priority, takže určité stránky budou nejprve procházené. Před souborem SITEMAP XML byly vyhledávače omezeny na indexování obsahu, který mohly najít pomocí následujících odkazů. To je stále důležitá funkce pro pavouky vyhledávačů, ale soubory SITEMAP XML usnadnily tvůrcům obsahu a vyhledávačům spolupráci.','Read <a href="%1$s" target="_blank">this article</a> for detailed instructions on setting up your Google Webmaster account and getting Rank Math to work with the Google Search Console.'=>'Přečtěte si <a href="%1$s" target="_blank">tento článek,</a> kde najdete podrobné pokyny k nastavení účtu pro webmastery Google a získání funkce Rank Math pro práci s Google Search Console.','You can integrate the Google Search Console with Rank math in the <a href="%1$s" target="_blank">Search Console tab</a>. of Rank Math\'s General Settings menu.'=>'Na <a href="%1$s" target="_blank">kartě Search Console</a> v základním nastavení Rank Math můžete integrovat službu Google Search Console.','Google\'s Search Console is a vital source of information concerning your rankings and click-through rates.  Rank Math can import this data, so you don\'t have to log into your Google account to get the data you need.'=>'Služba Search Console společnosti Google je důležitým zdrojem informací o vašem hodnocení a míře prokliku.  Rank Math může importovat tato data, takže se nemusíte přihlašovat ke svému účtu Google, abyste získali data, která potřebujete.','Register at Google Search Console and verificate your site by adding the code to <a href="%1$s">Settings &gt; Verificate Tools</a>, then navigate to <a href="%2$s">Settings &gt; Search Console</a> to authenticate and link your site.'=>'Zaregistrujte se ve službě Google Search Console a ověřte svůj web přidáním kódu do <a href="%1$s">nastavení &gt; Nástroje ověření</a>a potom přejděte do nastavení <a href="%2$s">&gt; Vyhledávací služba,</a> kde můžete svůj web ověřit a propojit.','Fixing the issue is simple - just edit the post/page and add the focus keyword(s) to the title.'=>'Řešení problému je jednoduché - stačí upravit příspěvek / stránku a přidat klíčové slovo(a) do názvu.','HTML Page Titles play a large role in Google\'s ranking algorithm.  When you add a Focus Keyword to a post or page, Rank Math will check to see that you used the keyword in the title.  If it finds any posts or pages that are missing the keyword in the title, it will tell you here.'=>'Názvy stránek HTML hrají velkou roli v algoritmu hodnocení Google. Když přidáte klíčové slovo k příspěvku nebo stránce, matiku hodnocení zkontroluje, zda jste klíčové slovo použili v názvu.  Pokud najde nějaké příspěvky nebo stránky, které chybí klíčové slovo v názvu, řekne vám to zde.','Make sure the focus keywords you set for the posts appear in their titles.'=>'Ujistěte se, že klíčová slova, které jste nastavili pro příspěvky, se zobrazují v jejich názvech.','Post Titles Missing Focus Keywords'=>'Názvy příspěvků bez klíčového slova','Fixing this issue is easy - just edit the post, and set a Focus Keyword.  Then follow Rank Math\'s analysis to improve your rankings.'=>'Řešení tohoto problému je snadné - stačí upravit příspěvek a nastavit klíčové slovo.  Pak postupujte podle analýzy Rank Math, abyste zlepšili své hodnocení.','Of course, if you don\'t give Rank Math a focus keyword to work with, it can\'t give you any useful feedback.'=>'Pokud ovšem nezadáte nástroji Rank Math klíčové slovo, na které se má zaměřit, nemůže vám poskytnout žádnou užitečnou zpětnou vazbu.','Rank Math uses these focus keywords to analyze your on-page content.  It can tell if you\'ve done a good job of optimizing your text to rank for these keywords.'=>'Rank Math používá tato klíčová slova k zaostření k analýze obsahu na stránce.  To může říct, jestli jste udělali dobrou práci optimalizace textu na hodnost pro tato klíčová slova.','Rank Math allows you to set a focus keyword for every post and page you write - the option is in the "Meta Box", which appears under the text editor in the screen where you write and edit content.'=>'Rank Math umožňuje nastavit klíčové slovo pro každý příspěvek a stránku, kterou napíšete - možnost je v "Meta Box", který se objeví pod textovým editorem na obrazovce, kde píšete a upravujete obsah.','Setting focus keywords for your posts allows Rank Math to analyse the content.'=>'Nastavení klíčových slov pro vaše příspěvky umožňí Rank Math analýzu obsahu.','Focus Keywords'=>'Klíčová slova','This looks nice for readers - and it gets your keywords into the URL (keywords in the URL is a ranking factor).'=>'To vypadá hezky pro čtenáře - a to dostane vaše klíčová slova do URL (klíčová slova v URL je faktor hodnocení).','This option will replace the "?p=99" part of the URL with the post\'s title, like this: http://www.yoursite.com/my-amazing-post-title/'=>'Tato možnost nahradí část URL "?p=99" názvem příspěvku, například takto: http://www.yoursite.com/my-amazing-post-title/','Fortunately, it\'s very easy to fix.  Just hop on over to <a target="_blank" href="%1$s">Settings - Permalinks</a>.  Then chose the "Post Name" option.'=>'Naštěstí je velmi snadné opravit.  Stačí naskočit do <a target="_blank" href="%1$s">nastavení - Permalinks</a>.  Pak zvolte možnost "Název příspěvku".','It\'s not very kind on the eyes, and it does nothing for your site\'s SEO.  In fact, it can hurt it - Google\'s bot is quite cautious about crawling pages that look auto-generated.'=>'Není to moc laskavý na oči, a to nedělá nic pro vaše stránky SEO.  Ve skutečnosti to může ublížit - Bot společnosti Google je poměrně opatrný při procházení stránek, které vypadají automaticky generované.','The standard permalink structure is pretty ugly - WordPress generates offputting URLs like: http://www.yoursite.com/?p=99'=>'Standardní permalink struktura je docela ošklivá - WordPress generuje offputting URL jako: http://www.yoursite.com/?p=99','For the best SEO results, use a custom permalink structure, preferably one that includes the post title (<code>%%postname%%</code>). You can change it by navigating to <a href="%s">Settings &gt; Permalinks</a>'=>'Pro nejlepší výsledky SEO použijte vlastní strukturu permalink, nejlépe ten, který obsahuje název příspěvku ( <code>%%postname%%</code> ). Můžete ji změnit tak, že přejdete na <a href="%s">Nastavení &gt; Permalinks</a>','Permalink Structure'=>'Struktura Trvalých odkazů','The tagline is the second option.  Choose a tagline that summarizes your site in a few words.  The tagline is also a good place to use your main keyword.'=>'Slogan je druhou možností.  Vyberte slogan, který shrnuje váš web několika slovy.  Slogan je také dobrým místem pro použití hlavního klíčového slova.','Changing your tagline is very easy.  Just head on over to <a target="_blank" href="%1$s">Settings - General</a> in WordPress\'s admin menu (on the left), or click on the link in this sentence.'=>'Změna sloganu je velmi snadná.  Stačí zamířit na více než do <a target="_blank" href="%1$s">nastavení - Obecné</a> v admin menu WordPress (vlevo), nebo klikněte na odkaz v této větě.','Unfortunately, the standard WordPress tagline is "Just Another WordPress site."  That\'s pretty sloppy looking, and it does nothing for your SEO.  In fact, it\'s actually a security risk - it makes it easy for hackers with a WordPress exploit to locate your site with an automated search.'=>'Standardní slogan WordPress je bohužel "Jen další web WordPressu".  To působí značně nedbale a nijak to neprospívá vašemu SEO.  Ve své podstatě je to vlastně bezpečnostní riziko - umožňuje to hackerům se zneužít systém WordPress snadno najít váš web pomocí automatického vyhledávání.','Most WordPress themes place your site\'s tagline in a prominent position (inside header tags near the top of the page).  Using the right tagline can give your site an SEO boost.'=>'Většina wordtiskových motivů umisťuje slogan vašeho webu na prominentní pozici (uvnitř značek záhlaví v horní části stránky).  Pomocí správného sloganu může dát vaše stránky SEO podporu.','Your theme may display the Site Tagline, and it can also be used in SEO titles &amp; descriptions. Set it to something unique. You can change it by navigating to <a href="%s">Settings &gt; General</a>.'=>'Vaše šablona může zobrazit štítek stránky a může být také použita v SEO názvech &amp; popisech. Nastavte na něco unikátního. Můžete to změnit navigací na <a href="%s">Nastavení &gt; Obecné</a>.','Site Tagline'=>'Popis webu','OK'=>'OK','SEO Score'=>'SEO skóre','SEO Analysis for this page'=>'SEO analýza pro tuto stránku','Analyze this Page'=>'Analyzovat tuto stránku','Site-wide analysis'=>'Analýza pro celý web','Size: %s'=>'Velikost: %s','Data Rows: %s'=>'Řádky dat: %s','Fetching in Progress'=>'Načítání probíhá','Update data manually'=>'Ruční aktualizace dat','Items'=>'Položky','Google oAuth is not authorized.'=>'Služba Google oAuth není autorizována.','Not a valid settings founds to delete cache.'=>'Není platné nastavení zjištěno, odstranit cache.','Average Position'=>'Průměrná pozice','Total Impressions'=>'Celkový počet zobrazení','Total Clicks'=>'Celkových kliknutí','Total Keywords'=>'Klíčová slova celkem','Not found'=>'Nenalezeno','Response Code'=>'Kód odpovědi','Bad request. Please check the code.'=>'Špatná žádost. Zkontrolujte kód.','Pages'=>'Stránky','Analytics'=>'Statistiky','You are not authorized to perform this action.'=>'Nejste oprávněni tuto akci provádět.','Service Type'=>'Objednávka','Application Category'=>'Kategorie aplikace','Operating System'=>'Operační systém','Price Currency'=>'Cena měny','Gender'=>'Pohlaví','Duration'=>'Délka','Menu URL'=>'Adresa URL nabídky','Serves Cuisine'=>'Slouží kuchyně','Recipe Instructions'=>'Recept návod','Recipe Ingredients'=>'Recept Ingredience','Recipe Video Description'=>'Recept Popis videa','Recipe Video Name'=>'Recept Název videa','Recipe Video Thumbnail'=>'Náhled videa receptu','Total Time'=>'Celkový čas','Cooking Time'=>'Doba vaření','Preparation Time'=>'Doba přípravy','Recipe Yield'=>'Recept Výnos','Keywords'=>'Klíčová slova','Cuisine'=>'Kuchyně','Product In-Stock'=>'Produkt skladem','Product Price'=>'Cena produktu','Product Currency'=>'Měna produktu','Product Brand'=>'Značka produktu','Product SKU'=>'Kód produktu','Closing Time'=>'Zavírací doba','Opening Time'=>'Otevírací doba','Unpublish when expired'=>'Rozbalit, když vypršela platnost','Expiry Posted'=>'Zaúčtováno s vypršením platnosti','Date Posted'=>'Datum vložení','Salary Currency'=>'Měna platu','Stock Inventory'=>'Skladové zásoby','Availability Starts'=>'Dostupnost začíná','Availability'=>'Dostupnost','Currency'=>'Měna','Entry Price'=>'Vstupní cena','Ticket URL'=>'URL vstupenky','End Date'=>'Do dne','Start Date'=>'Od dne','Event Status'=>'Stav události','Venue URL'=>'URL místa konání','Venue Name'=>'Název místa konání','Event Type'=>'Typ události','Course Provider URL'=>'Adresa URL poskytovatele kurzu','Course Provider'=>'Zprostředkovatel kurzu','ISBN'=>'Isbn','Edition'=>'Edice','Author'=>'Autor','Url'=>'URL','Headline'=>'Titulek','Extend the functionality of WordPress by creating redirects in our plugin when you change the slug of a post, page, category or a CPT. You can modify the redirection further according to your needs.'=>'Rozšiřte funkčnost WordPress vytvořením přesměrování v našem pluginu, když změníte slimák příspěvku, stránky, kategorie nebo CPT. Přesměrování můžete dále upravit podle svých potřeb.','Auto Post Redirect'=>'Automatické přesměrování příspěvku','Custom Url '=>'Vlastní adresa URL ','Custom Redirection'=>'Vlastní přesměrování','Redirect to Homepage'=>'Přesměrovat na domovskou stránku','Default 404'=>'Výchozí 404','Fallback Behavior'=>'Záložní chování','Display the Debug Console instead of being redirected. Administrators only.'=>'Místo přesměrování zobrazte konzolu pro ladění. Pouze správci.','Debug Redirections'=>'Přesměrování ladění','Export to Nginx config file'=>'Export do konfigurátoru Nginx','Export to .htaccess'=>'Exportovat do .htaccess','Add New'=>'Přidat nové','Redirections can be exported to your .htaccess file for faster redirections, in SEO > Settings > Import/Export.'=>'Přesměrování lze exportovat do souboru .htaccess pro rychlejší přesměrování, v SEO > Nastavení > importu/ exportu.','Using a 302 <em>temporary</em> redirection is useful when you want to test a new page for client feedback temporarily without affecting the SEO scores of the original page.'=>'Použití 302 <em>dočasné</em> přesměrování je užitečné, pokud chcete otestovat novou stránku pro zpětnou vazbu klienta dočasně bez ovlivnění SEO skóre původní stránky.','301 redirections are <em>permanent</em>. The old URL will be removed in search engines and replaced by the new one, passing on SearchRank and other SEO scores. Browsers may also store the new URL in cache and redirect to it even after the redirection is deleted from the list here.'=>'Přesměrování 301 jsou <em>trvalá</em>. Stará adresa URL bude ve vyhledávačích odstraněna a nahrazena novou, přičemž se předá SearchRank a další SEO hodnocení. Prohlížeče také mohou novou adresu URL uložit do mezipaměti a přesměrovat na ni i poté, co je přesměrování ze seznamu zde odstraněno.','Here you can set up custom redirections. It is important to choose the right type of redirection.'=>'Zde můžete nastavit vlastní přesměrování. Je důležité zvolit správný typ přesměrování.','You can also activate, deactivate, or delete multiple items at once using the Bulk Actions dropdown.'=>'Můžete také aktivovat, deaktivovat nebo odstranit více položek najednou pomocí rozevíracího panelu Hromadné akce.','<strong>Delete</strong> permanently removes the redirection.'=>'<strong>Odstranit</strong> trvale odebere přesměrování.','<strong>Activate/Deactivate</strong> redirections. Deactivated redirections do not take effect on your site.'=>'<strong>Aktivace/deaktivace</strong> přesměrování. Deaktivovaná přesměrování se na vašem webu neprojeví.','<strong>Edit</strong> redirection details: from/to URLs and the redirection type.'=>'<strong>Upravte</strong> podrobnosti přesměrování: z/na adresy URL a typ přesměrování.','<strong>Note:</strong> This interstitial page is displayed only to administrators. Site visitors are redirected without delay.'=>'<strong>Poznámka:</strong> Tato vsunutá stránka je zobrazena pouze správcům. Návštěvníci webu jsou neprodleně přesměrováni.','Manage All Redirections'=>'Spravovat všechna přesměrování','Manage This Redirection'=>'Spravovat toto přesměrování','Continue redirecting'=>'Pokračovat v přesměrování','Stop Redirection'=>'Zrušit přesměrování','Redirecting in %s seconds...'=>'Přesměrování za %s sekund...',' To '=>' 